            trt_options.device_id = 0;
            trt_options.has_trt_options = 1;
            trt_options.trt_max_workspace_size = (UIntPtr) (1<<30);
            trt_options.trt_fp16_enable = 1;
            trt_options.trt_int8_enable = 1;
            trt_options.trt_int8_calibration_table_name = "C:\calibration.flatbuffers";
            trt_options.trt_int8_use_native_calibration_table = 0;

**Motivation and Context**
- Why is this change required? What problem does it solve?
- If it fixes an open issue, please link to the issue here.

When cross-compiling for iOS (`arm64`), the build fails with an include error on including `cpuid.h` in `onnxruntime/core/common/threadpool.cc`:
```cpp
#elif defined(__APPLE__)
#include <cpuid.h>
#else
```
As far as I can tell, the header is used here:
```cpp
void ThreadPoolProfiler::LogRun(int thread_idx) {
  if (enabled_) {
    child_thread_stats_[thread_idx].num_run_++;
    auto now = Clock::now();
    if (child_thread_stats_[thread_idx].core_ < 0 ||
        TimeDiffMicroSeconds(child_thread_stats_[thread_idx].last_logged_point_, now) > 10000) {
#ifdef _WIN32
      child_thread_stats_[thread_idx].core_ = GetCurrentProcessorNumber();
#elif defined(__APPLE__)
      uint32_t CPUInfo[4];
      __cpuid_count(1, 0, CPUInfo[0], CPUInfo[1], CPUInfo[2], CPUInfo[3]);
      if ((CPUInfo[3] & (1 << 9)) != 0) {
        child_thread_stats_[thread_idx].core_ = (unsigned)CPUInfo[1] >> 24;
      }
#else
      child_thread_stats_[thread_idx].core_ = sched_getcpu();
#endif
      child_thread_stats_[thread_idx].last_logged_point_ = now;
    }
  }
}
```
and also in `ThreadPoolProfiler::MainThreadStat::LogCore`. From the header in the Xcode default toolchain:
```cpp
#if !(__x86_64__ || __i386__)
#error this header is for x86 only
#endif
```
This doesn't fail CI because as far as I can tell, CI compiles for the simulator, not for the device.

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): macOS 11.0.1, cross-compiling for iOS
- ONNX Runtime installed from (source or binary): source
- ONNX Runtime version: `master`
- GCC/Compiler version (if compiling from source): Clang 12.0.0

**To Reproduce**
1. Clone ORT `master`
2. Run default iOS cross-compile as specified in `BUILD.md`

